import React from 'react';

import { ItemContainer, ItemInfo, ItemImage, Title, Text } from './styles';

const ResidentItem = ({ resident: { id, name, type, image } }) => (
  <ItemContainer>
    <ItemImage>
      <img src={image} alt={type} />
    </ItemImage>
    <ItemInfo>
      <>
        <Title>{name}</Title>
        <Text>{type}</Text>
        <Text>{type}</Text>
      </>
    </ItemInfo>
  </ItemContainer>
);

export default ResidentItem;
